class Form extends Component {
  render() {
    return (
      <div className="container contactInfo">
        <div className="picture">
          {/* <img id="profilePic" src={me} alt="Profile pic"></img> */}
          <h1>Test</h1>
        </div>
        <div className="infoArea">
          <h1>Travis Lloyd</h1>
          <h2>Travislloyd@lloyddm.com</h2>
